//libs
import { scroller } from "react-scroll";

//images
import headerLogo from "../../images/Logo.svg";

//styled components
import {
  ButtonAnchor,
  Container,
  Logo,
  NavContainer,
  WideContainer,
} from "./Header.styled";

const Header = () => {
  return (
    <WideContainer>
      <Container>
        <Logo src={headerLogo} alt="header-logo" />
        <NavContainer>
          <ButtonAnchor
            href="#"
            onClick={() => {
              scroller.scrollTo("");
            }}
          >
            Users
          </ButtonAnchor>
          <ButtonAnchor href="#sign-in-form">Sign Up</ButtonAnchor>
        </NavContainer>
      </Container>
    </WideContainer>
  );
};

export default Header;
